import React from 'react'
import { NavLink } from 'react-router-dom'
import { BsWhatsapp } from "react-icons/bs";

function Header() {
  return (
    <>
        
        <nav>
        <div></div>
            <NavLink to="/">
                <BsWhatsapp/>
            </NavLink>
            
        </nav>
    </>
  )
}

export default Header
